import { GridColumn, GridRow } from "emotion-flex-grid";
import React from "react";
import "./MenuMobile.css";

export default function Menu() {
  return (
    <div>
      <GridRow direction="column" className="menu-container">
        <GridColumn>
          <h2>Deposit</h2>
        </GridColumn>

        <h2>Dashboard</h2>
        <h2>Company</h2>
        <h2>Pricing</h2>
      </GridRow>
    </div>
  );
}
